        <script>

            var election_counties =<?php echo json_encode($election_division); ?>;
            var districts =<?php echo json_encode($districts_results); ?>;
            var district = districts[4];
            var display = document.getElementById("display");
            var pointedElement; //this i need to find element that is pointed by mouse pointer
            function br(element) {
                var children = element.children;
                for (let item of children) {
                    item.setAttribute("fill-opacity", "1");
                }
                hideDescription(element)
            }
            function bl(element) {
                var children = element.children;
                for (let item of children) {
                    item.setAttribute("fill-opacity", "0.7");
                }
                showDescription(element)
            }
            function grn(element) {

                var children = element.children;
                for (let item of children) {
                    item.setAttribute("fill", "#0DF146");
                }
                showDescription(element)
            }
            function gr(element) {
                var children = element.children;
                for (let item of children) {
                    item.setAttribute("fill", "#7F8C8D");
                }
                hideDescription(element)
            }

            function showDescription() {
                var display = document.getElementById("display");
                display.style.display = "block";
            }
            function hideDescription() {

                display.style.display = "none";
            }
            function showCoords(event) {

                var wHeight = window.innerHeight;
                var wWidth = window.innerWidth;
                var cX = event.clientX;
                var cY = event.clientY;
                getPointedElement(cX, cY);
                var regionElement = pointedElement.parentNode;
                var regionColor = pointedElement.getAttribute("fill");
                var display = document.getElementById("display");
                var districtId = regionElement.getAttribute("id");
                var displayHead = document.getElementById('displayHead');
                displayHead.style.background = regionColor;
                displayHead.style.margin = 90;
                displayHead.innerHTML = election_counties[districtId];
                var displayBody = document.getElementById('displayBody');
                var displayHeight = displayHead.offsetHeight + displayBody.offsetHeight;
                if (wHeight - cY < 300) {
                    cY = cY - displayHeight;
                }

                if (wWidth - cX < 450) {
                    cX = cX - 450;
                }

                display.style.left = cX + 20 + "px";
                display.style.top = cY - 10 + "px";
                var district = districts[districtId];
                if (districtId > 0) {//i have some id`s -water-body, i dont want them to mess here things

                    var displayBodyText = "<p>" + district.message + "</p>";


                    displayBodyText += "<table class=\"table table-sm \"><thead></thead><tbody>";
                    var candidates = district.districtCandidates;
                    if (candidates != null) {
                        for (candidate of candidates) {
                            displayBodyText += "<tr><td style=\"width:40px\">" + candidate.supporting_party.party_number + "</td><td><img src=\"party_logos/" + candidate.supporting_party.party_logo_name + "\" style=\"width:40px\"></td><td><span style=\"font-weight:bold\" >" + candidate.first_name + " " + candidate.last_name + "</span><br><span class=\"small\">" + candidate.supporting_party.party_name + "</span></td><td><span style=\"font-weight:bold\" >"  + candidate.percent + "%</span><br><span class=\"small\">"+candidate.votes+" ხმა</span></td></tr>";
                        }
                    }
                    /* for (c of candidates) {
                     if (c.length > 1) {
                     //displayBodyText+="<tr><td>"+candidate[0]+"</td><td><table table-sm><tr style=\"font-size:16px; font-weight:bold\"><td>"+candidate[1]+"</td></tr><tr style=\"font-size=6px\"><td >"+candidate[2]+"</td></tr></table></td></tr>";
                     displayBodyText += "<tr><td style=\"width:40px\">" + c.first_name + "</td><td><img src=\"party_logos/" + c.party_logo_name + "\" style=\"width:40px\"></td><td><span style=\"font-weight:bold\" >" + cc_first_name + "</span><br><span class=\"small\">" + c.last_name + "</span></td></tr>";
                     } else {
                     
                     
                     }
                     }*/


                    displayBodyText += "</tbody > </table>"
                    displayBody.innerHTML = displayBodyText;
                }
            }

            //this is for the switch mechanism for switching georgia and tbilisi maps
            var georgianMapSmall = 0;
            var switchnumber = 0;

            function rescale() {
                var tbilisi = document.getElementById("tbilisi_platform");
                var georgia = document.getElementById("georgia_platform");
                tbilisi.setAttribute("transform", "translate(200, 50) scale(0.5)");
                tbilisi.setAttribute("visibility", "visible");
                georgia.setAttribute("transform", "translate(0, 0) scale(0.2)");
                var el = document.getElementById("31"); //31 is tbilisi on big map
                el.setAttribute("onclick", "restore()");
                el.setAttribute("onmouseout", "");
                georgianMapSmall++;
            }

            function restore() {
                if (georgianMapSmall > switchnumber) {

                    switchnumber++;
                } else {
                    var district = pointedElement.parentNode.getAttribute("id");
                    if (georgianMapSmall != 1 && district != 31) {
                        //diladi map big
                        goMajoritarianCounty();
                    } else {


                        var tbilisi = document.getElementById("tbilisi_platform");
                        var georgia = document.getElementById("georgia_platform");
                        tbilisi.setAttribute("transform", "translate(400, 200) scale(0.1)");
                        tbilisi.setAttribute("visibility", "hidden");
                        georgia.setAttribute("transform", "translate(0, 0) scale(1)");
                        var el = document.getElementById("31");
                        el.setAttribute("onclick", "rescale()");
                        el.setAttribute("onmouseout", "gr(this)");
                        var children = el.children;
                        for (let item of children) {
                            item.setAttribute("fill", "#7F8C8D");
                        }

                        switchnumber = 0;
                        georgianMapSmall = 0;

                    }
                }

            }
            function getPointedElement(cX, cY) {

                pointedElement = document.elementFromPoint(cX, cY);
                //pointedElement is global variable
            }
            function goMajoritarianCounty() {
                var regionElement = pointedElement.parentNode;
                var district = regionElement.getAttribute("id");
                var districtId = document.getElementById("districtId");
                districtId.setAttribute("value", district)
                var submitButton = document.getElementById("submitButton");
                submitButton.click();
            }
